private void writeJsonIter(Iterator val) throws IOException {
  incLevel();
  boolean first=true;
  while( val.hasNext() ) {
    if( !first ) indent();
    writeVal(null, val.next());
    if( val.hasNext() ) {
      writeArraySeparator();
    }
    first=false;
  }
  decLevel();
}

